import React from "react";
import styles from './about.module.css';

const About = () => {
    return (
        <>
            <section id={styles.aboutContainer}>

                <div>
                    <h1>About me</h1>
                </div>

                <div>
                    <img src="" alt="Image of me" />
                </div>
            </section>
        </>

    )
}

export default About;
